CREATE TABLE IF NOT EXISTS `Farmaco` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `principio_activo` varchar(77) DEFAULT NULL,
  `marca_registrada` varchar(100) DEFAULT NULL,
  `forma` varchar(45) DEFAULT NULL,
  `presentacion` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15254 DEFAULT CHARSET=utf8;

